sg\\u003dAOvVaw01vx_hIQvWYt5_CFLmiZsZ\",\"Alika Istiqomah\",\"https://lh3.googleusercontent.com/a-/ACB-R5SHNXKnarXT1VcSXApCFSMx9rNd8mZ9WVG8dZMGnw\\u003ds120-c-c0x00000000-cc-rp-mo-ba3-br100\",\"0ahUKEwiGi_ijrKv9AhVaUGwGHdkHAiQQ4h4IdSgB\"],\"CAESBkVnSUlBdw\\u003d\\u003d\"],[[\"/url?q\\u003dhttps://www.google.com/maps/contrib/115924254618426351776%3Fhl%3Did\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwiGi_ijrKv9AhVaUGwGHdkHAiQQ4h4IgQEoAA\\u0026usg\\u003dAOvVaw1rrzmdID-GU-hnXuI9MyHy\",\"Ikka Erniasari\",\"https://lh3.googleusercontent.com/a-/ACB-R5TU6LbI6x_Nwulz5cqYvs25b__sUOp--lDkxxSU_g\\u003ds120-c-c0x00000000-cc-rp-mo-br100\",\"0ahUKEwiGi_ijrKv9AhVaUGwGHdkHAiQQ4h4IgQEoAA\"],\"sebulan lalu\",null,\"Keren banget. Buat belajar sejarah sama anak2 SD kelas 4 yang udah dapet pelajaran IPAS. Jadi lebih mudah menjelaskan karna ada dioramanya. Bagus2 dioramanya dan terawat.\\n\\nKurangnya cuma waktu naik ke puncak monas. Kuota per sesi 200tiket dan salam sehari ada 6 sesi. Paling pagi sesi jam 8 pagi dan terakhir jam 3 sore. Udah antri lama banget eh diserobot rombongan anak TK dari luar kota udah gitu di puncaknya ternyata sempit hahaha cuma bisa teropongan sebentar ga sampe 10menit. Antri naik liftnya 3jam. Kapok.\\n\\nMohon manajemen antriannya di atur bener deh ini pengelola. Masa pengunjung umum harus ngalah sama pengunjung rombongan. Kita sama-sama bayar loh. Kalau memang mereka ada slot khusus, mohon penjualan tiketnya diatur lagi. Ada slot 200tiket kan buat memperpendek antrian bukan justru bikin lama.\\n\\nSaran aja kalau mau ke Monas lebih baik weekday dan pagi aja. Selain sepi (ga ada rombongan) bisa lebih leluasa juga. Bisa piknik ala2 di tamannya juga, malah adem di taman bisa tidur2an. Tiket masuk museumnya 5ribu, tiket puncak 20rb per orang. Belinya pakai kartu Jackard. Jd yg udah punya Jackard dibawa yaaa... oiya masuknya bisa lewat IRTI atau stasiun Gambir ya. Jangan lupa bawa minum dan snack yaaaa....\\n\\nHave fun!\",5,null,\"115924254618426351776\",[\"https://  Kita sama-sama bayar loh. Kalau memang mereka ada slot khusus, mohon penjualan tiketnya diatur lagi. Ada slot 200tiket kan buat memperpendek antrian bukan justru bikin lama.\\n\\nSaran aja kalau mau ke Monas lebih baik weekday dan pagi aja. Selain sepi (ga ada rombongan) bisa lebih leluasa juga. Bisa piknik ala2 di tamannya juga, malah adem di taman bisa tidur2an. Tiket masuk museumnya 5ribu, tiket puncak 20rb per orang. Belinya pakai kartu Jackard. Jd yg udah punya Jackard dibawa yaaa... oiya masuknya bisa lewat IRTI atau stasiun Gambir ya. Jangan lupa bawa minum dan snack yaaaa....\\n\\nHave fun!\",\"id\",null,null,null,null,null,null,[0,170]],[[\"AF1QipMCezE_1UK9bxhR5P7lDQ4qMrJwmrUQWLgxH6J-\",[\"AF1QipMCezE_1UK9bxhR5P7lDQ4qMrJwmrUQWLgxH6J-\",null,null,null,null,null,[\"https://lh5.googleusercontent.com/p/AF1QipMCezE_1UK9bxhR5P7lDQ4qMrJwmrUQWLgxH6J-\\u003dw150-h150-k-no-p\"],null,null,\"9DP3Y4ZB2qCx4w_Zj4igAg\",\"0ahUKEwiGi_ijrKv9AhVaUGwGHdkHAiQQzCcI6gIoAw\",[\"http://www.google.com/local/imagery/report/?cb_client\\u003dmaps_sv.tactile\\u0026image_key\\u003d!1e10!2sAF1QipMCezE_1UK9bxhR5P7lDQ4qMrJwmrUQWLgxH6J-\",null,null,\"0ahUKEwiGi_ijrKv9AhVaUGwGHdkHAiQQ-y4I6wIoAA\"],null,null,null,null,null,null,null,null,null,[[1],[10,\"AF1QipMCezE_1UK9bxhR5P7lDQ4qMrJwmrUQWLgxH6J-\"],[10,3,[4624,2084],null,null,null,null,null,null,\"AF1QipMCezE_1UK9bxhR5P7lDQ4qMrJwmrUQWLgxH6J-\"],[null,null,null,null,null,null,null,[\"Monumen Nasional\",\"id\"]],[null,[[[\"Ikka Erniasari\"],\"https://www.google.com/maps/contrib/115924254618426351776?hl\\u003did\",\"https://lh3.googleusercontent.com/a-/ACB-R5TU6LbI6x_Nwulz5cqYvs25b__sUOp--lDkxxSU_g\\u003ds120-c-c0x00000000-cc-rp-mo-br100\"]]],null,[2,0,null,null,null,[null,null,\"photos:gmm_android_review_post\",[6,7,4,1,3]],null,[2023,1,14,null,null,null,null,null,[\"sebulan lalu\"]],[2023,1,17,14,null,null,null,null,[\"sebulan lalu\"]]],[\"//www.google.com/local/imagery/report/?cb_client\\u003dmaps_sv.tactile\\u0026image_key\\u003d!1e10!2sAF
